import React from 'react';
import styled from 'styled-components';

import Cell from './Cell';

const Container = styled.div`
    display:flex;
    flex-wrap : wrap;
    width : 250px;
`;

function Region(){
    return (
        <Container>
            {[1,2,3,4,5,6,7,8,9].map(i=> <Cell key={i}/>)}
        </Container>
    )
}

export default Region;
